import React from 'react';

class SmallContent3 extends React.Component {
    constructor(props) {
        super(props);

    }

    render() {
      return (
            <div id="contentContainer">
                  <div className="contentCanvas">
                      <ul id="soloProList">
                          <li id="soloPro1"></li>
                          <li id="soloPro1"></li>
                          <li id="soloPro1"></li>
                      </ul>
                  </div>
                  <style jsx>
                    {`
                      #contentContainer {
                        position: absolute;
                        height: 100%;
                        width: 90%;
                        background-image: url('data:image/png;base64,');
                        background-color: rgb(192,192,192);
                        border-radius: 8px;
                        transform: translateX(-200%);
                        right: 25%;
                      }

                      @media (max-width: 720px) {

                        #contentContainer {
                          height: 100%;
                          min-height: 575px;
                        }
                      }
                    
                      .contentCanvas {
                        margin-top: 0px;
                        z-index: 15;
                        height: 100%;
                        width: 100%;
                        transform: translate(0, 7.5%);
                      }

                      @media (max-width: 720px) {
                        .contentCanvas {
                          transform: translate(0, 5.5%);
                        }
                      }
                    
                      #soloProList {
                        margin: auto;
                        list-style: none;
                        font-size: 1.6em;
                        width: 80%;
                        height: 90%;
                        left: 50%;
                        top: 50%;
                        transform: translate(-50%, -50%);
                        padding: 0;
                        position: absolute;
                        display: table;
                        vertical-align: middle;
                      }

                      @media (max-width: 720px) {
                        #soloProList {
                          width: 60%;
                          min-width: 300px;
                        }
                      }
                    
                      #soloPro1 {
                        display: table-row;
                      }
                  `}
                  </style>
            </div>
);
}
}


export default SmallContent3;
